import React, {memo} from 'react';
import styled from 'styled-components';

const JoinContainer = styled.div``;

const Join = memo(() => {
    return (
        <JoinContainer>
            <div className='contentWrap'>
                <img src='/img/logo.png' alt='내일응원 로고' />
                <div className='loginContainer'>
                    <form className='loginWrap'>
                        <input type='text' placeholder='아이디를 입력하세요' />
                        <input type='text' placeholder='비밀번호를 입력하세요' />
                        <button type='submit' className='submitBtn'>로그인하기</button>
                    </form>
                </div>
                <div className='joinWrap'>
                    <span className='join'>회원가입</span>
                    <span className='idSearch'>아이디 찾기</span>
                    <span className='pwSearch'>비밀번호 찾기</span>
                </div>
            </div>
        </JoinContainer>
    );
});

export default Join;
